import React from "react";
import { NavLink } from "react-router-dom";

const Navigation = () => {
  return (
    <div>
      <NavLink to="/">Home</NavLink>
      <NavLink>About</NavLink>
      <NavLink>Contact</NavLink>
    </div>
  );
};

export default Navigation;
